DROP TABLE IF EXISTS `User_Nominations`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `User_Nominations` (
  `User_Email_Address` varchar(100) NOT NULL,
  `Movie_Name` varchar(100) NOT NULL,
  `Movie_ReleaseDate` date NOT NULL,
  `Award_Name` varchar(100) NOT NULL,
  `Award_Iteration_Number` int NOT NULL,
  `Staff_FirstName` varchar(50) NOT NULL,
  `Staff_LastName` varchar(50) NOT NULL,
  UNIQUE KEY `unique_user_nomination` (`User_Email_Address`,`Movie_Name`,`Movie_ReleaseDate`,`Award_Name`,`Award_Iteration_Number`),
  KEY `Movie_Name` (`Movie_Name`,`Movie_ReleaseDate`),
  KEY `Award_Name` (`Award_Name`,`Award_Iteration_Number`),
  KEY `Staff_FirstName` (`Staff_FirstName`,`Staff_LastName`),
  CONSTRAINT `user_nominations_ibfk_1` FOREIGN KEY (`User_Email_Address`) REFERENCES `Users` (`Email_Address`) ON DELETE CASCADE,
  CONSTRAINT `user_nominations_ibfk_2` FOREIGN KEY (`Movie_Name`, `Movie_ReleaseDate`) REFERENCES `Movie` (`Movie_Name`, `Release_Date`) ON DELETE CASCADE,
  CONSTRAINT `user_nominations_ibfk_3` FOREIGN KEY (`Award_Name`, `Award_Iteration_Number`) REFERENCES `Nomination` (`Award_Name`, `Iteration_Number`) ON DELETE CASCADE,
  CONSTRAINT `user_nominations_ibfk_4` FOREIGN KEY (`Staff_FirstName`, `Staff_LastName`) REFERENCES `Staff` (`FirstName`, `LastName`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
